      <h4>NewDeaths {allcases.NewDeaths} </h4>
      <h4>TotalRecovered {allcases.TotalRecovered} </h4>
      <h4>ActiveCases {allcases.ActiveCases} </h4>
      <h4>LastUpdated {allcases.LastUpdated} </h4>
    </>
    })}


